import axios from 'axios'
const osnovniUrl = 'http://127.0.0.1:3001/api/vjezbe'
 
const dohvatiSve = () => {
    return axios.get(osnovniUrl)
    .then(response => {
        console.log("Zahtjev je dovršen uspješno.")
    })
    .catch ( error => {
        alert(
            `Ne ucitava podatke. `
          )
        console.log("Greska")
    })
}
export default {
    dohvatiSve: dohvatiSve
}
